		NAME2 = "낡은카드첩",
		DESCRICAO = {
			"[Kunlun, The Hermit Land]",
			"Kunlun is a land in the clouds.",
			"Being so high in the air provides an unprecedented view of the world, and also grants",
			"a different mindset to those who allow themselves to think freely.",
			"The ^FF0000Statue of Kunlun's Greatest Philosopher^000000, stands proudly in the middle of the city, ready to",
			"inspire great thoughts in all who contemplate it. Throughout Kunlun there are ^FF0000Spectacular World Viewpoints^000000.",
			"But there are specific points that are exceptionally impressive, please be careful where you step.",
			"There is a ^FF0000small hill in Kunlun^000000 that is said to have been the favorite meditation spot of the Great Philosopher,",
			"you must visit her and see if you are overcome by grandiose thoughts.",
			"No matter how large a culture is, there will always be some among its citizens who simply don't 'get it'.",
			"Those in Kunlun's history who always thought small, over time, truly shrank and eventually disappeared.",
			"But before that, they had a ^FF0000Mini-city^000000 where they lived on the ground, below Kunlun.",
			"This place is a practical lesson against stagnant thinking.",
			"[Don't forget to take pictures of all these things and show them to your Tour Guide.]",
		},
		slotCount = 0,
		ClassNum = 0,
		costume = false
	},
