			"Louyang is a spiritual country, where the warrior spirit and clear thinking are highly valued.",
			"Wonderful places, such as the ^FF0000Statue of Man and Tiger^000000, can inspire you to do your best.",
			"Louyang has a different perspective on healing the mind and body. While Rune-Midgard depends on the science of potions,",
			"and Faith for healing, the healers of Louyang practice their art in a \"^FF0000Hospital^000000\".",
			"In a Hospital, your body will be healed by a system of body manipulations and diet.",
			"The beautiful ^FF0000Palace^000000 protected by the Great Wall of Louyang is truly a spectacular sight for all visitors.",
			"To accompany their proud heritage of Martial Arts and spiritual training, they frequently practice exercises to make their bodies",
